import React from "react";

const VideoItem = ({ video }) => {
  console.log(video);
  return (
    <div>
      <img
        src={video.snippet.thumbnails.default.url}
        alt={video.snippet.title}
      />
      <h3>{video.snippet.title}</h3>
    </div>
  );
};

export default VideoItem;
